import React from "react";

const ContactList = ({contacts}) => {
    return <div>
         {contacts.map(({ name, number, sex }) => (
                <ul>
                    <li>name: {name}</li>
                    <li>number: {number}</li>
                    <li>sex: {sex}</li>
                </ul>
            ))}

    </div>
}

export default ContactList
